import React from "react";
const SubjectCard = (props)=>{



  return(
    <div className="m-5 z-10">
      <div className="h-52 w-72 rounded-3xl shadow-xl flex items-center cursor-pointer bg-white" onClick={() => props.call(props.data)}>
        <p className="font-bold text-teal-accent-400 text-5xl mx-auto">{props.data.subName}</p>
      </div>
    </div>
  );
};

export default SubjectCard;
